import React from 'react';

const DuplasItem = ({ dupla, index, onRemove }) => {
  return (
    <li className="duplas-item" onDoubleClick={() => onRemove(index)}>
      Dupla {index + 1}: {dupla.join(' e ')}
    </li>
  );
};

export default DuplasItem;
